    false,nt"url": null,nt"notes": "In the 1960s the USFWS and WDFW attempted
    to translocate Dusky Canada geese to the lower islands of the Lewis and Clark NWR.
     The attempt formed a Western Canada Goose hybrid that became a resident population
    of dark geese that are difficult to distinguish from the nonhunted Dusky Canada
    geese.  WDFW has been gathering information on these Resident Dark Geese (RDGs)
    by identifying nesting patterns and collaring adults off the nest.  Gathering nesting
    data helps WDFW keep track of the ratio of dark to light geese, allows for an assessment
    of control options, and allows for collaring and radio-tagging of adults.  Collaring
    these geese signals to hunters that they are not Dusky Canada Geese and can be harvested.
     The refuge participates in these WDFW-led surveys because many of them occur within
    the Lewis and Clark NWR Boundary and because the initial translocation attempt was
    sponsored by the USFWS.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
